::: {.cell}

```{.r .cell-code}
setwd("C:/Users/HT Chen/Desktop/ISSS626/ISSS626-wp/Hands-on_Ex/Hands-on_Ex03")
fire_sf <- read_csv("data/rawdata/forestfires.csv") %>%
  st_as_sf(coords = c("longitude", "latitude"),
                       crs = 4326) %>%
  st_transform(crs = 32748)
```
:::



::: {.cell}

```{.r .cell-code}
fire_sf <- fire_sf %>% 
  mutate(DayofYear = yday(acq_date)) %>%
  mutate(Month_num = month(acq_date)) %>%
  mutate(Month_fac = month(acq_date, 
                           label = TRUE, 
                           abbr = FALSE))
```
:::



::: {.cell}

```{.r .cell-code}
#DIY
```
:::



::: {.cell}

```{.r .cell-code}
tm_shape(kbb_sf)+
  tm_polygons() +
tm_shape(fire_sf) +
  tm_dots()
```

::: {.cell-output-display}
![](Hands-on_Ex03_files/figure-html/unnamed-chunk-10-1.png){width=672}
:::
:::



::: {.cell}

```{.r .cell-code}
#DIY2(More edit on catography eg. display each month fire dots)
```
:::



::: {.cell}

```{.r .cell-code}
tm_shape(kbb_sf)+
  tm_polygons() +
tm_shape(fire_sf) +
  tm_dots(size=0.1) +
tm_facets(by="Month_fac",
          free.coords=FALSE,
          drop.units = TRUE)
```

::: {.cell-output-display}
![](Hands-on_Ex03_files/figure-html/unnamed-chunk-12-1.png){width=672}
:::
:::



::: {.cell}

```{.r .cell-code}
fire_month <- fire_sf %>% 
  select(Month_num)
```
:::



::: {.cell}

```{.r .cell-code}
